import React from "react";
import "./App.scss";
//Components
import Header from "./components/header";
import HTMLContent from "./components/htmlContent";
import { Section } from "./section"


import { Canvas } from "react-three-fiber";


export default function App() {
  return (
    <>
      <Header />
      <Canvas
        colorManagement
        camera={{ position:[0,0,200], fov:175 }}>
            <Section 
            factor={1.5} // props used for the scrolling effect
            offset={1} // props used for the scrolling effect 
            >
              <HTMLContent/>
            </Section>
      </Canvas>
    </>
  );
}
